import{_ as e,o as t,c as o,O as a}from"./chunks/framework.9482e208.js";const h=JSON.parse('{"title":"§ 36-156.3 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/36-156.3.md","filePath":"vacode/36-156.3.md"}'),r={name:"vacode/36-156.3.md"},n=a('<h1 id="§-36-156-3-definitions" tabindex="-1">§ 36-156.3 Definitions. <a class="header-anchor" href="#§-36-156-3-definitions" aria-label="Permalink to &quot;§ 36-156.3 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;CDFI&quot; means a community development financial institution that provides credit and financial services for underserved communities.</p><p>&quot;Department&quot; means the Department of Agriculture and Consumer Services.</p><p>&quot;Fund&quot; means the Virginia Food Access Investment Fund.</p><p>&quot;Funding&quot; means loans, forgivable loans, and grants made from the Fund.</p><p>&quot;Grocery store&quot; means a for-profit or not-for-profit self-service retail establishment that primarily sells meat, seafood, fruits, vegetables, dairy products, dry groceries, household products, and sundries.</p><p>&quot;Innovative food retail project&quot; means an innovative project, including a mobile market or a delivery model, that addresses food access issues in an underserved community.</p><p>&quot;Program&quot; means the Virginia Food Access Investment Program.</p><p>&quot;Small food retailer,&quot; also referred to as a small-scale store, neighborhood store, small grocery, farmer&#39;s market, or bodega, means a small retail outlet of under 2,500 square feet that sells a limited selection of foods and other products.</p><p>&quot;Underserved community&quot; means a census tract determined to be an area with low supermarket access either by the U.S. Department of Agriculture (USDA), as identified in the USDA Food Access Research Atlas, or through a methodology that has been adopted for use by another governmental or philanthropic healthy food initiative.</p><p>2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0956" target="_blank" rel="noreferrer">956</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0957" target="_blank" rel="noreferrer">957</a>.</p>',12),i=[n];function s(d,l,c,u,m,p){return t(),o("div",null,i)}const _=e(r,[["render",s]]);export{h as __pageData,_ as default};
